import React from "react";
import "./NavBar.css";
import { NavLink } from "react-router-dom";
import { useIsAuthenticated, useAuthUser } from "react-auth-kit";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHouse, faRightToBracket } from "@fortawesome/free-solid-svg-icons";

const NavigationBar = () => {
  const authUser = useAuthUser();
  const isAuthenticated = useIsAuthenticated();
  return (
    <nav>
      <ul className="side left-side">
        <a
          id="news"
          href="/"
          className={({ isActive }) => (isActive ? "active" : undefined)}
          end
        >
          <FontAwesomeIcon icon={faHouse} /> Home
        </a>

        <a
          href="contact"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Contact
        </a>

        <a
          href="about"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          About
        </a>

        {isAuthenticated() && (
          <a
            href="presentation"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Academy
          </a>
        )}

        {isAuthenticated() && (
          <a
            href="activePresentations"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Active Presentations
          </a>
        )}
      </ul>

      <ul className="side right-side">
        {isAuthenticated() && (
          <a
            id="contact-sales"
            href="joinALecture"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Join a lecture
          </a>
        )}

        {isAuthenticated() && (
          <a
            href="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Sign Out
          </a>
        )}

        <a
          href="signOut"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Play
        </a>

        <a
          id="sign-up"
          href="signOut"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Sign Up
        </a>

        <a
          href="signOut"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Log in
        </a>
      </ul>
    </nav>
    // {isAuthenticated() && (
    //   <div className="user-greeting">Hello {authUser().firstName}</div>
    // )}
  );
};

export default NavigationBar;
